script: |
  super -f text -I q12725.spq | sort > q12725.out

inputs:
  - name: q12725.spq
    data: |
      SELECT DISTINCT - col0 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE + col2 NOT IN ( - - ( - col1 ) + - + ( col1 ), 73 * + 98, ( col1 ), - - col0 * col0 * col0 );
  - name: tab0

outputs:
  - name: q12725.out
    data: |
      -15
      -87
      -97
